import { Col, Container, Row } from 'react-bootstrap';

function Filter() {
  return (
    <Container fluid>
      <Row className="w-100 d-flex justify-content-center align-items-center">
        <Col md={7}>123</Col>
      </Row>
    </Container>
  );
}

export default Filter;
